pragma solidity ^0.8.0;
import "@openzeppelin/contracts/utils/Strings.sol";
import "./Array.sol";
import "./BytesLib.sol";

library StringLib {
    using BytesLib for bytes;
    using StringLib for string;
    using Array for string[];


    function toHexString(uint256 value) internal pure returns (string memory) {
        return Strings.toHexString(value);
    }

    function toHexString(uint256 value, uint256 length) internal pure returns (string memory) {
        return Strings.toHexString(value,length);
    }
    function toString(uint256 value) internal pure returns (string memory) {
        return Strings.toString(value);
    }


    function significative(uint256 _value)  internal pure returns (uint256)
    {
        while (_value!=0 && _value%10==0)
            _value/=10;
        return _value;
    }
    function toDecimalString(uint256 _value) internal pure returns (string memory) {
        uint _significative=significative(_value%10**18);
        if (_significative!=0)
            return Strings.toString(_value/10**18).concat(".").concat(Strings.toString(_significative));
        else
            return Strings.toString(_value/10**18);
    }


    function concat(string memory str_, string memory add_) internal pure returns (string memory out_) {
        bytes memory _bstr = bytes(str_);
        bytes memory _badd = bytes(add_);

        bytes memory _bout = new bytes(_bstr.length + _badd.length);

        for( uint i; i<_bstr.length; i++) 
            _bout[i] = _bstr[i];
        for( uint i; i<_badd.length; i++) 
            _bout[i+_bstr.length] = _badd[i];

        return string(_bout);
    }


    function format(string memory str_, string memory add1_, string memory add2_, string memory add3_, string memory add4_, string memory add5_, string memory add6_) internal pure returns (string memory out_) {
        return str_.format(add1_,add2_,add3_,add4_).format(add5_,add6_);
    }
    function format(string memory str_, string memory add1_, string memory add2_, string memory add3_, string memory add4_, string memory add5_) internal pure returns (string memory out_) {
        return str_.format(add1_,add2_,add3_,add4_).format(add5_);
    }
    function format(string memory str_, string memory add1_, string memory add2_, string memory add3_, string memory add4_) internal pure returns (string memory out_) {
        return str_.format(add1_,add2_).format(add3_,add4_);
    }
    function format(string memory str_, string memory add1_, string memory add2_, string memory add3_) internal pure returns (string memory out_) {
        return str_.format(add1_,add2_).format(add3_);
    }
    function format(string memory str_, string memory add1_, string memory add2_) internal pure returns (string memory out_) {
        return str_.format(add1_).format(add2_);
    }
    bytes private constant _fmt = bytes("{}");
    bytes private constant _escape = bytes("\\");

    function format(string memory str_, string memory add_) internal pure returns (string memory out_) {
        bytes memory _bstr = bytes(str_);
        bytes memory _badd = bytes(add_);

        bytes memory _bout = new bytes(_bstr.length + _badd.length);

        uint ip;
        uint op;
        for( ; ip<_bstr.length; ip++)
        {
            uint j;
            if (ip<_bstr.length-_escape.length+1)
            {
                for (j=0;j<_escape.length;j++)
                    if (_bstr[ip+j]!=_escape[j])
                        break;
                if (j==_escape.length)
                {
                    uint _strlen = _bout.length-_escape.length;
                    assembly {
                        mstore(_bout, _strlen)
                    }
                    ip+=_escape.length;
                    _bout[op++] = _bstr[ip];
                    continue;
                }
            }
            if (ip<_bstr.length-_fmt.length+1)
            {
                for (j=0;j<_fmt.length;j++)
                    if (_bstr[ip+j]!=_fmt[j])
                        break;
                if (j==_fmt.length)
                    break;
            }
            _bout[op++] = _bstr[ip];
        }
        if (ip<_bstr.length-_fmt.length+1)
        {
            // found
            uint _strlen = _bout.length-_fmt.length;
            assembly {
                mstore(_bout, _strlen)
            }

            for( uint ap; ap<_badd.length; ap++) 
                _bout[op++] = _badd[ap];
            ip+=_fmt.length;


        }
        for( ; ip<_bstr.length; ip++)
            _bout[op++] = _bstr[ip];


        return string(_bout);
    }
    function split(string memory str_, string memory searched_) internal pure returns (string[] memory out_) {
        return split(str_,searched_,0);
    }
    function split(string memory str_, string memory searchedstr_,bytes1 escape_ ) internal pure returns (string[] memory out_) {
        bytes memory _bstr = bytes(str_);
        bytes memory _bsearched_ = bytes(searchedstr_);
        bytes1 c = 'c';

        if (_bstr.length<_bsearched_.length)
            return out_.push(str_);
        uint previousi=0;
        for(uint i ; i<_bstr.length-1; i++)
        {
            if (escape_!=0 && _bstr[i]==escape_)
            {
                i++;
                continue;
            }
            uint j;
            for (;j<_bsearched_.length;j++)
                if (_bstr[i+j]!=_bsearched_[j])
                    break;
            if (j==_bsearched_.length)
            {
                out_.push(string(_bstr.slice(previousi,i-previousi)));
                previousi = i+_bsearched_.length;
                i+=_bsearched_.length-1;
            }
        }
        out_.push(string(_bstr.slice(previousi,_bstr.length-previousi)));
    }

    function include(string memory str_, string memory searched_) internal pure returns (bool) {
        return include(str_,searched_,0);
    }
    function include(string memory str_, string memory searched_,bytes1 escape_ ) internal pure returns (bool) {
        bytes memory _bstr = bytes(str_);
        bytes memory _bsearched_ = bytes(searched_);
        if (_bstr.length==0)
            return false;
        for(uint i ; i<_bstr.length-1; i++)
        {
            if (escape_!=0 && _bstr[i]==escape_)
            {
                i++;
                continue;
            }
            for (uint j=0;j<_bsearched_.length;j++)
                if (_bstr[i]==_bsearched_[j])
                    return true;
        }
        return false;
    }

}
contract StringModifier {
    modifier doesIncludes(string memory str_, string memory searched_,bytes1 escape_) {
        require(StringLib.include(str_,searched_,escape_));
        _;
    }
    modifier doesNotIncludes(string memory str_, string memory searched_,bytes1 escape_) {
        require(!StringLib.include(str_,searched_,escape_));
        _;
    }
}
